'use strict';

var DashboardPage = require('../models/pages/DashboardPage.js');

const dashboardPage = async ({ page, request, selectors, grafanaVersion }, use, testInfo) => {
  const dashboardPage2 = new DashboardPage.DashboardPage({ page, selectors, grafanaVersion, request, testInfo });
  await dashboardPage2.goto();
  await use(dashboardPage2);
};

exports.dashboardPage = dashboardPage;
